import React from "react";
import CardList from "./CardList";
import { robots } from "./robots";

const App = () => {
  return (
    <main>
      <header className="tc">
        <h1>Robo Friends App</h1>
        <input type="text" placeholder="put text" />
      </header>
      <CardList robots={robots} />;
    </main>
  );
};

export default App;
